import React from "react";
// import "./style.css";

function SearchResults(props) {
  return (
    <table class="table">
      <thead>
        <tr>
          <th scope="col">#</th>
          <th scope="col">First</th>
          <th scope="col">Last</th>
          <th scope="col">Handle</th>
        </tr>
      </thead>
      <thead>
        <tbody>
          {/* <li  key={props.first} className="list-group-item"> */}
          <td>{props.first}</td>
          <td>{props.last}</td>
          <td>{props.email}</td>
        </tbody>
      </thead>
    </table>
  );
}

export default SearchResults;
